                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                    <Col span={8}>
                                        <Form.Item
                                            name={'pre_end_time'}
                                            label="End time"
                                            labelCol={{span: 9, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                    <Col span={8}>
                                        <Form.Item
                                            name={'pre_number_of_pulses'}
                                            label="# of pulses"
                                            labelCol={{span: 9, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                </Row>
                                <Divider orientation="left" plain><strong>Post-frac pulses</strong></Divider>
                                <Row gutter={24}>
                                    <Col span={8}>
                                        <Form.Item
                                            name={'post_start_time'}
                                            label="Start time"
                                            labelCol={{span: 9, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                    <Col span={8}>
                                        <Form.Item
                                            name={'post_end_time'}
                                            label="End time"
                                            labelCol={{span: 9, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                    <Col span={8}>
                                        <Form.Item
                                            name={'post_number_of_pulses'}
                                            label="# of pulses"
                                            labelCol={{span: 9, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                </Row>
                            </Form>
                        </Card>
                    </Panel>
                    <Panel header={<strong>Notes</strong>} >
                    <Card>
                            <Form
                                name="notes_data_form"
                                onValuesChange={notesFataFormChange}
                                autoComplete="off"
                            >

                                <Row gutter={24}>
                                    <Col span={20}>
                                        <Form.Item
                                            name={'pre_notes'}
                                            label="Pre-frac pulse notes"
                                            labelCol={{span: 5, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <TextArea rows={4} />
                                        </Form.Item>
                                    </Col>
                                </Row>
                                <Row gutter={24}>
                                    <Col span={20}>
                                        <Form.Item
                                            name={'post_notes'}
                                            label="Post-frac pulse notes"
                                            labelCol={{span: 5, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <TextArea rows={4} />
                                        </Form.Item>
                                    </Col>
                                </Row>
                                <Row gutter={24}>
                                    <Col span={20}>
                                        <Form.Item
                                            name={'other_notes'}
                                            label="Other notes"
                                            labelCol={{span: 5, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <TextArea rows={4} />
                                        </Form.Item>
                                    </Col>
                                </Row>
                            </Form>
                        </Card>
                    </Panel>
                </Collapse>
                <div className="mt-4 w-full text-right">
                    <span className="mr-4">Last submitted date: 08/07/2021</span>
                    <Button type="primary">Submit tracking sheet</Button>
                </div>
            </Card>
            {
                showConfirmationModal && 
                <ConfirmationModal
                    isModalVisible={showConfirmationModal}
                    handleCancel={handleCancel}
                    handleOk={handleAddStageConfirmed}
                    modalTitle={"Add stage"}
                    modalText={"Are you sure you want to another stage ?"}
                    footerButtons={{cancel_text: 'Cancel', confirm_text: 'Yes'}}
                    data={modalData}
                >
                </ConfirmationModal>
            }
        </>
    );
}
